import {HeaderWrapper,Logo,Nav} from './style';

class Header extends Component{
    render(){
        return(
           <HeaderWrapper>
               <Logo href='/'/>
               <Nav/>
           </HeaderWrapper> 
        )
    }
}

export default Header;
